import AdminPage from './component/adminpage'
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [coinsArr, setcoinsArr] = useState([]);

  useEffect(async () => {
    await axios.get('https://coinscore-cc-backend.onrender.com/api/collections/getcoins')
    .then(data => setcoinsArr(data.data.data))
    .catch
  }, [])

  console.log(coinsArr);

  return (
    <div className="App">
     <AdminPage />
    </div>
  );
}

export default App;
